import React from "react";
import { Link } from "react-router-dom";
import Logo from '../Assets/logo.png';
import mdi_account from '../Assets/mdi_account-alert-outline.png';
import searchIcon from '../Assets/akar-icons_search.png';
import heartIcon from '../Assets/akar-icons_heart.png';
import shipping_cart from '../Assets/Vector.png';

const Navbar = () => {
    return (
        <header className="bg-white shadow-md sticky top-0 z-50">
            <div className="container mx-auto px-2 flex justify-between items-center py-4">

                <div className="flex items-center space-x-2">
                    <div className="w-[45px] h-[45px] flex justify-center items-center">
                        <img src={Logo} alt="Furniro Logo" />
                    </div>
                    <h1 className="text-[34px] montserrat font-bold text-[#000000]">Furniro</h1>
                </div>


                <nav className="space-x-8 poppins-medium text-[16px]">
                    <Link to="/" className="hover:text-yellow-500 ">Home</Link>
                    <Link to="/shop" className="hover:text-yellow-500">Shop</Link>
                    <Link to="/about" className="hover:text-yellow-500">About</Link>
                    <Link to="/contact" className="hover:text-yellow-500">Contact</Link>
                </nav>

                <div className="flex items-center space-x-6">
                    <div className="w-[20px] h-[20px] flex justify-center items-center">
                        <img src={mdi_account} alt="mdi_account" />
                    </div>
                    <div className="w-[20px] h-[20px] flex justify-center items-center">
                        <img src={searchIcon} alt="searchIcon" />
                    </div>
                    <div className="w-[20px] h-[20px] flex justify-center items-center">
                        <img src={heartIcon} alt="heartIcon" />
                    </div>

                    <div className="w-[20px] h-[20px] flex justify-center items-center">
                        <img src={shipping_cart} alt="shipping_cart" />
                    </div>
                </div>
            </div>
        </header>
    );
};

export default Navbar;
